import React from 'react';
import { Col, Container, Row } from "react-bootstrap";


import styles from "../css/MapEncora.module.css";
import NavBar from "./Navbar";

const Map = () => {
  return (
    <div className={styles.map_encora}>
      <NavBar />
      <Container>
        <h1>Welcome to Encora!</h1>
      </Container>
    </div>
  );
}

export default Map;
